import React, { useState } from 'react'

const App = () => {
    const [input, setInput] = useState('')
    const handleChange = (e) => {
        setInput(e.target.value)
    }
    return (
        <div>
            <input placeholder="search" onChange={handleChange} />
            <button onClick={(e) => setInput()}>add</button>
            <h1>{input}</h1>
        </div>
    )
}

export default App
